import React from "react";
import { useQuery } from "@apollo/client";
import { GET_MY_PROFILE } from "../gql/queries";

const Profile = () => {
  const { loading, data, error } = useQuery(GET_MY_PROFILE);
  if (loading) return <h1> Loading ...</h1>;
  if (error) throw new Error(error.message);
  console.log(data);
  return (
    <>
      <div>
        <h5> {data.myprofile.name} </h5>
        <h5> {data.myprofile.email} </h5>
      </div>

      {data.myprofile.quotes.length === 0 ? (
        <h1> No Quotes availavle </h1>
      ) : (
        <blockquote>
          <h6> {data.myprofile.quotes.title} </h6>
          <p> {data.myprofile.quotes.name} </p>
        </blockquote>
      )}
      <blockquote>
        <h6> {data.myprofile.quotes.title} </h6>
        <p> {data.myprofile.quotes.name} </p>
      </blockquote>
    </>
  );
};

export default Profile;
